import React, { useState, useEffect } from "react";
import { Route, Switch } from "react-router-dom";
import NavBar from "./components/NavBar"
import BonsaiList from "./components/BonsaiList"
import About from "./components/About";
import BonsaiCollection from "./components/BonsaiCollection";
import BonsaiForm from "./components/BonsaiForm"

function App() {
  const [bonsa, setPlants] = useState([]);

  useEffect(() => {
    fetch("http://localhost:3000/bonsais")
      .then((r) => r.json())
      .then((data) => setPlants(data));
  }, []);

  console.log(plants);

  return (
    <div>
      <NavBar />
      <Switch>
        <Route path="/bonsaicollection" element={<BonsaiCollection plants={plants} />} />
        <Route path="/about" element={<About />} />
        <Route path="/addbonsai" element={<BonsaiForm />} />
      </Switch>
    </div>
  );
}

export default App;
